-- ----------------------------
-- Table structure for wo_assignee
-- ----------------------------
DROP TABLE IF EXISTS `wo_assignee`;
CREATE TABLE `wo_assignee`  (
                                `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
                                `order_id` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '工单号，主键为三个字段，顺序为order_id+assignee_version+assignee，不能乱了，否则影响到索引',
                                `assignee_version` int(2) NOT NULL DEFAULT 1 COMMENT '工单任务代理人的版本号，为防止影响到已有流程而设计',
                                `assignee` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '工单任务代理人的用户ID',
                                `assignee_order` int(2) UNSIGNED NOT NULL DEFAULT 1 COMMENT '工单任务代理人的顺序，从1开始，用于表示此工单任务代理人为第几个审批人/处理人',
                                `task_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '审批' COMMENT '任务(节点)名',
                                `order_status` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '1' COMMENT '流程执行到此任务(节点)时的工单状态，参考order_status表',
                                `can_cancel_order` tinyint(1) NOT NULL DEFAULT 0 COMMENT '此工单任务代理人是否可以取消工单',
                                `create_user` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '创建人',
                                `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
                                `update_user` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '更新人',
                                `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
                                `remark` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
                                PRIMARY KEY (`id`) USING BTREE,
                                INDEX `k_handle_order`(`assignee_order`) USING BTREE,
                                UNIQUE INDEX `uk_wo_assignee`(`order_id`, `assignee_version`, `assignee`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 14 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '工单处理人表' ROW_FORMAT = Dynamic;

